def high_and_low(numbers):
    numbers = list(numbers.split(' '))
    max_min=[int(numbers[0]),int(numbers[0])]
    for element in numbers:
        try:
            element=int(element)
            print(element)
            if element>max_min[0] and element!='':
                max_min[0]=element
            if element < max_min[1] and element!='':
                max_min[1]=element
        except'ValueError':
            pass
    print(str(max_min[0])+" "+str(max_min[1]))




string=('8 3 -5 42 -1 0 0 -9 4 7 4 -4 8 3 -5 42 -1 0 0 -9 4 7 4 -4')
high_and_low(string)